import React from "react";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";

const MyPage = () => {
  return (
    <>
      <Header />
      <h2>My Page</h2>
      <h3>내 정보</h3>
      <h3>내가 올린 매물</h3>
      <h3>문의 사항</h3>
      <Footer />
    </>
  );
};

export default MyPage;
